import React, {useEffect, useState} from 'react';
import {ErrorMessage, Field, Form, Formik} from 'formik';
import * as Yup from 'yup';
import axios from 'axios';
import {Button, FormControl, InputLabel} from "@mui/material";
import {MenuItem} from "react-pro-sidebar";

const validationSchema = Yup.object().shape({
    startDestination: Yup.string().required('Start destination is required'),
    endDestination: Yup.string()
        .required('End destination is required')
        .notOneOf([Yup.ref('startDestination')], 'End destination cannot be the same as start destination'),
});

function MyForm() {
    const [places, setPlaces] = useState([]);
    const [initialValues, setInitialValues] = useState({
        startDestination: '',
        endDestination: '',
    });

    useEffect(() => {
        // Fetch places from your API using Axios
        axios.get('your_api_endpoint')
            .then((response) => {
                setPlaces(response.data);
            })
            .catch((error) => {
                console.error('Error fetching places:', error);
            });
    }, []);

    return (
        <Formik
            initialValues={initialValues}
            validationSchema={validationSchema}
            onSubmit={(values) => {
                // Handle form submission here
                console.log('Form submitted with values:', values);
            }}
        >
            <Form>
                <div>
                    <FormControl>
                        <InputLabel htmlFor="startDestination">Start Destination</InputLabel>
                        <Field as="select" name="startDestination" id="startDestination">
                            <MenuItem value="" disabled>Select a start destination</MenuItem>
                            {places.map((place) => (
                                <MenuItem key={place.id} value={place.id}>
                                    {place.name}
                                </MenuItem>
                            ))}
                        </Field>
                        <ErrorMessage name="startDestination" component="div" className="error"/>
                    </FormControl>
                </div>
                <div>
                    <FormControl>
                        <InputLabel htmlFor="endDestination">End Destination</InputLabel>
                        <Field as="select" name="endDestination" id="endDestination">
                            <MenuItem value="" disabled>Select an end destination</MenuItem>
                            {places.map((place) => (
                                <MenuItem key={place.id} value={place.id}>
                                    {place.name}
                                </MenuItem>
                            ))}
                        </Field>
                        <ErrorMessage name="endDestination" component="div" className="error"/>
                    </FormControl>
                </div>
                <div>
                    <Button variant="contained" color="primary" type="submit">
                        Submit
                    </Button>
                </div>
            </Form>
        </Formik>
    );
}

export default MyForm;
